webpackJsonp([28495531620475],{2617:function(e,n){e.exports={pathContext:{docHtml:'<h1>uuid <a href="http://travis-ci.org/kelektiv/node-uuid"><img src="https://secure.travis-ci.org/kelektiv/node-uuid.svg?branch=master" alt="Build Status"></a></h1>\n<p>Simple, fast generation of <a href="http://www.ietf.org/rfc/rfc4122.txt">RFC4122</a> UUIDS.</p>\n<p>Features:</p>\n<ul>\n<li>Generate RFC4122 version 1 or version 4 UUIDs</li>\n<li>Runs in node.js and browsers</li>\n<li>Cryptographically strong random number generation on supporting platforms</li>\n<li>Small footprint  (Want something smaller? <a href="https://gist.github.com/982883">Check this out</a>!)</li>\n</ul>\n<h2>Quickstart - CommonJS (Recommended)</h2>\n<pre><code class="language-shell">npm install uuid\n</code></pre>\n<pre><code class="language-javascript">// Generate a v1 UUID (time-based)\nconst uuidV1 = require(\'uuid/v1\');\nuuidV1(); // -> \'6c84fb90-12c4-11e1-840d-7b25c5ee775a\'\n\n// Generate a v4 UUID (random)\nconst uuidV4 = require(\'uuid/v4\');\nuuidV4(); // -> \'110ec58a-a0f2-4ac4-8393-c866d813b8d1\'\n</code></pre>\n<h2>Quickstart - Pre-packaged for browsers (Not recommended)</h2>\n<p>Browser-ready versions of this module are available via <a href="https://github.com/jfhbrook/wzrd.in">wzrd.in</a>.</p>\n<pre><code class="language-html">&#x3C;script src="http://wzrd.in/standalone/uuid@latest">&#x3C;/script>\n\n&#x3C;script>\nuuid.v1(); // -> v1 UUID\nuuid.v4(); // -> v4 UUID\n&#x3C;/script>\n</code></pre>\n<p>(Note: Do not do this in production.  Just don\'t.  wzrd.in is a great service, but if you\'re deploying a "real" service you should be using a packaging tool like browserify or webpack.  If you do go this route you would be well advised to link to a specific version instead of <code>uuid@latest</code> to avoid having your code break when we roll out breaking changes.)</p>\n<h2>API</h2>\n<h3>uuid(...)</h3>\n<p>Generate a V4 uuid. See uuid.v4 documentation below.</p>\n<h3>uuid.v1([<code>options</code> [, <code>buffer</code> [, <code>offset</code>]]])</h3>\n<p>Generate and return a RFC4122 v1 (timestamp-based) UUID.</p>\n<ul>\n<li>\n<p><code>options</code> - (Object) Optional uuid state to apply. Properties may include:</p>\n<ul>\n<li><code>node</code> - (Array) Node id as Array of 6 bytes (per 4.1.6). Default: Randomly generated ID.  See note 1.</li>\n<li><code>clockseq</code> - (Number between 0 - 0x3fff) RFC clock sequence.  Default: An internally maintained clockseq is used.</li>\n<li><code>msecs</code> - (Number | Date) Time in milliseconds since unix Epoch.  Default: The current time is used.</li>\n<li><code>nsecs</code> - (Number between 0-9999) additional time, in 100-nanosecond units. Ignored if <code>msecs</code> is unspecified. Default: internal uuid counter is used, as per 4.2.1.2.</li>\n</ul>\n</li>\n<li>\n<p><code>buffer</code> - (Array | Buffer) Array or buffer where UUID bytes are to be written.</p>\n</li>\n<li>\n<p><code>offset</code> - (Number) Starting index in <code>buffer</code> at which to begin writing.</p>\n</li>\n</ul>\n<p>Returns <code>buffer</code>, if specified, otherwise the string form of the UUID</p>\n<p>Notes:</p>\n<ol>\n<li>The randomly generated node id is only guaranteed to stay constant for the lifetime of the current JS runtime. (Future versions of this module may use persistent storage mechanisms to extend this guarantee.)</li>\n</ol>\n<p>Example: Generate string UUID with fully-specified options</p>\n<pre><code class="language-javascript">uuid.v1({\n  node: [0x01, 0x23, 0x45, 0x67, 0x89, 0xab],\n  clockseq: 0x1234,\n  msecs: new Date(\'2011-11-01\').getTime(),\n  nsecs: 5678\n});   // -> "710b962e-041c-11e1-9234-0123456789ab"\n</code></pre>\n<p>Example: In-place generation of two binary IDs</p>\n<pre><code class="language-javascript">// Generate two ids in an array\nconst arr = new Array(32); // -> []\nuuid.v1(null, arr, 0);   // -> [02 a2 ce 90 14 32 11 e1 85 58 0b 48 8e 4f c1 15]\nuuid.v1(null, arr, 16);  // -> [02 a2 ce 90 14 32 11 e1 85 58 0b 48 8e 4f c1 15 02 a3 1c b0 14 32 11 e1 85 58 0b 48 8e 4f c1 15]\n</code></pre>\n<h3>uuid.v4([<code>options</code> [, <code>buffer</code> [, <code>offset</code>]]])</h3>\n<p>Generate and return a RFC4122 v4 UUID.</p>\n<ul>\n<li>\n<p><code>options</code> - (Object) Optional uuid state to apply. Properties may include:</p>\n<ul>\n<li><code>random</code> - (Number[16]) Array of 16 numbers (0-255) to use in place of randomly generated values</li>\n<li><code>rng</code> - (Function) Random # generator to use.  Set to one of the built-in generators - <code>uuid.mathRNG</code> (all platforms), <code>uuid.nodeRNG</code> (node.js only), <code>uuid.whatwgRNG</code> (WebKit only) - or a custom function that returns an array[16] of byte values.</li>\n</ul>\n</li>\n<li>\n<p><code>buffer</code> - (Array | Buffer) Array or buffer where UUID bytes are to be written.</p>\n</li>\n<li>\n<p><code>offset</code> - (Number) Starting index in <code>buffer</code> at which to begin writing.</p>\n</li>\n</ul>\n<p>Returns <code>buffer</code>, if specified, otherwise the string form of the UUID</p>\n<p>Example: Generate string UUID with fully-specified options</p>\n<pre><code class="language-javascript">uuid.v4({\n  random: [\n    0x10, 0x91, 0x56, 0xbe, 0xc4, 0xfb, 0xc1, 0xea,\n    0x71, 0xb4, 0xef, 0xe1, 0x67, 0x1c, 0x58, 0x36\n  ]\n});\n// -> "109156be-c4fb-41ea-b1b4-efe1671c5836"\n</code></pre>\n<p>Example: Generate two IDs in a single buffer</p>\n<pre><code class="language-javascript">const buffer = new Array(32); // (or \'new Buffer\' in node.js)\nuuid.v4(null, buffer, 0);\nuuid.v4(null, buffer, 16);\n</code></pre>\n<h2>Testing</h2>\n<pre><code>npm test\n</code></pre>\n<h2>Legacy node-uuid package</h2>\n<p>The code for the legacy node-uuid package is available in the <code>node-uuid</code> branch.</p>',docPath:"argo-ci/node_modules/fsevents/node_modules/uuid/readme",proj:"argo-ci"}}}});
